import React, { useEffect } from 'react';
import Swiper from 'swiper/bundle';
import 'swiper/css/bundle'; 
import './MainPage.css';

const images = [
  { src: 'data:image/jpeg;base64,', name: 'Biryani' },
  { src: 'data:image/jpeg;base64,', name: 'Paneer Tikka' },
  { src: 'data:image/jpeg;base64,', name: 'Samosa' },
  { src: 'data:image/jpeg;base64,', name: 'Butter Chicken' },
  { src: 'data:image/jpeg;base64,', name: 'Chole Bhature' },
  { src: 'data:image/jpeg;base64,', name: 'Rogan Josh' },
  { src: 'data:image/jpeg;base64,', name: 'Pani Puri' },
];
export const FoodSlider = () => {
  useEffect(() => {
    const swiper = new Swiper('.swiper-container', {
      loop: true,
      spaceBetween: 0,  
      
      navigation: {
        nextEl: '.swiper-button-next',
        prevEl: '.swiper-button-prev',
      },
      breakpoints: {
        480: {
          slidesPerView: 1,
        },
        768: {
          slidesPerView: 2,
        },
        1024: {
          slidesPerView: 3, 
        },
        1440: {
          slidesPerView: 6, 
        },
      },
    });

    return () => {
      swiper.destroy();
    };
  }, []);

  return (

    <div className='slider-back'>
      <div className='all-btn'>
        <h3 className='slider-title'>What's on your mind?</h3>
        <div className="swiper-button-prev"></div>
        <div className="swiper-button-next"></div>
      </div>
      <div className="swiper-container">
        <div className="swiper-wrapper">
          {images.map((image, index) => (
            <div className="swiper-slide" key={index}>
            <img src={image.src} alt={`Slide ${index + 1}`} />
            <h6>{image.name}</h6>
        </div>
      ))}
      </div>
      </div>
    </div>

  );
};